script: |
  super -f text -I q5168.spq | sort > q5168.out

inputs:
  - name: q5168.spq
    data: |
      SELECT ALL COUNT ( + 36 ) FROM tab1 (FORMAT parquet) WHERE NOT col0 * col1 - col2 * + 45 BETWEEN - col0 AND + 22 * + - col1 * - col0 - - col0 * - col0;
  - name: tab1

outputs:
  - name: q5168.out
    data: |
      2
